import React from 'react';
import { Card } from 'react-bootstrap';

interface StatisticsProps {
    symbol?: string;
    name?: string;
    price?: string;
    dollar_difference?: string;
    percent_difference?: string;
}

const StatisticsWidget = ({ symbol, name, price, dollar_difference, percent_difference }: StatisticsProps) => {
    return (
        <Card className="text-center">
            <Card.Title className="card-title">{name}</Card.Title>
            <Card.Subtitle className="text-muted">{price}</Card.Subtitle>
            <Card.Body className="card-body">
                {symbol} and {dollar_difference} and {percent_difference}
            </Card.Body>
        </Card>
    );
};

export default StatisticsWidget;
